import { Actif } from '../../models/actif.model'; // Adjust the path as needed

export class ListActifsComponent implements OnInit {
  actifs: Actif[] = [];  // Use Actif[] instead of any[]
  
  constructor(private actifService: ActifService) {}

  ngOnInit(): void {
    this.actifService.getAllActifs().subscribe(data => {
      this.actifs = data;
    });
  }
}
